import React from 'react'
import { 
    Pagination,
    Stack,
    makeStyles,
 
} from '@mui/material'

const useStyles = makeStyles(theme => ({
    root: {
        postion: "fixed",
        bottom: 0,
        zIndex: 200,

    }
})
)



function AppPagination() {
  return (
    <div>
        <div>
        <Stack spacing={2}>
            <Pagination count={10} shape="rounded" />
        </Stack>   
      
        </div>
    </div>
  )
}

export default AppPagination
